weixin.desc:
获取微信签名的接口请使用get(application/json)方式，跨域需接口支持，返回格式如下：<br/>
           {
              data: {
                appId: 'appId',
                timestamp: 15888888,
                nonceStr: 'nonceStr',
                signature: 'signature',
              },
              msg: '不为空则提示该消息'
           }
